/*
 * This file contains images in RAW binary format that can be easily displayed
 * on screen using straightforward algorithm. See lcd.c for the procedure.
 * The format itself consists in an array of 16-bit unsigned integers. First
 * two integers represent length and height of the image. Next integers
 * represent pixels from first to last, each integer represents a color
 * assigned to corresponding pixel. You should note that those images are
 * stored inside flash memory together with instructions and the format is very
 * inefficient, so you should store here only small images such as icons. Big
 * images, such as full-screen photos, should be stored in some external
 * memory, preferrably in some compressed format such as JPEG; even though this
 * one should also do the job given its simpleness and drawing speed. Also note
 * that the Big Endian format is used here.
 */

